import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
      <Hero />
      <main>
        <Post />
        <CommentList />
      </main>
    </div>
  );
}

function Header() {
  return (
    <header className="header">
      <img className="header__logo" src="" />
      <div className="header__right">
        <input className="search" placeholder="Search..." />
        <p className="lastPressed">+ UPLOAD</p>
        <img className="Mohan" src="/assets/images/mohan-murge.jpg" />
      </div>
    </header>
  );
}

function Hero() {
  return <video post=""> </video>;
}

function Post() {
  return (
    <div className="post">
      <div className="post--title">
        <h2>BMX Rampage: 2018 Highlights</h2>
      </div>
      <div className="post--writer">
        <h3>By Red Cow</h3>
        <h3>12/18/2018</h3>
      </div>
      <div className="post--likes">
        <h3>1,001,023</h3>
        <h3>110,985</h3>
      </div>
      <div className="post--content">
        On a gusty day in Southern Utah, a group of 25 daring mountain bikers
        blew the doors off what is possible on two wheels, unleashing some of
        the biggest moments the sport has ever seen. While mother nature only
        allowed for one full run before the conditions made it impossible to
        ride, that was all that was needed for event veteran Kyle Strait, who
        won the event for the second time -- eight years after his first Red Cow
        Rampage title
      </div>
    </div>
  );
}

function CommentList() {}

const users = [
  {
    firstName: "John",
    lastName: "Smith",
    age: 25
  },
